import logoImage from './assets/devmemory_logo.png'

const App = ()=>{
  return(
    <C.Container>
      <C.Info>
        <C.LogoLink href="">
          <img src={logoImage} width="200" alt=""/>
        </C.LogoLink>

        <C.InfoArea>
          ...
        </C.InfoArea>

        <button>Reiniciar</button>
      </C.Info>
      <C.GridArea>
        ...
      </C.GridArea>
    </C.Container>
  );
}

export default App;
